import Layout from '../components/Layout'
import Head from 'next/head'

const Index = () => (
    <Layout>
        <Head>
            <title>My website</title>
        </Head>
        <div>
            <h1>Hello World!</h1>
            <style jsx>{`
                h1 {
                    color: yellow;
                    background-color: red;
                }
            `}</style>
        </div>
    </Layout>
)

export default Index
